pragma solidity ^0.4.23;

/*
This contract is the "instantiation" of MessagingInterface. This is the
contract that is initialized for each ABTS request so we can mitigate our
scalability concerns.
*/
import "./MessagingInterface.sol";

import "openzeppelin-solidity/contracts/math/SafeMath.sol";

contract AbtsRequestWithoutReef {
  using SafeMath for uint256;

  address private txInitiator;
  address private txReceiver;
  uint256 private amount;
  uint8 private trustScoreThreshold;

  MessagingInterface public messagingInterface;
  uint public constant coralFeeInEth = 0.01 * 1 ether;
  address public coralWallet;

  constructor(
    address MessagingInterfaceAddress, address _txReceiver, uint8 _trustScoreThreshold
  ) public payable {
    require(_trustScoreThreshold >= 0);
    require(_txReceiver != address(0));

    txReceiver = _txReceiver;
    trustScoreThreshold = _trustScoreThreshold;

    messagingInterface = MessagingInterface(MessagingInterfaceAddress);

    coralWallet = messagingInterface.coralWallet();
  }

  function initiateScoreRetrieval() public payable returns(bool) {
    require(msg.value >= coralFeeInEth);
    amount = msg.value;
    txInitiator = msg.sender;

    messagingInterface.notifyOfNewAbtsRequest(address(this), txReceiver, trustScoreThreshold);
    return true;
  }

  /*
  The function that's called when the recipient's ABTS is below the transaction
  initiator's ABTS threshold. Initial funds are transferred back to the initiator
  sans the coral fee, which is transferred to coral's wallet
  */
  function revertTransaction() payable public {
    /* require(msg.sender == coralWallet); */
    txInitiator.transfer(amount.sub(coralFeeInEth));
    coralWallet.transfer(coralFeeInEth);
    messagingInterface.notifyOfRevertTransaction(txInitiator);
  }

  /*
  The function that's called when the recipient's ABTS is above the transaction
  initiator's ABTS threshold. Initial funds are transferred on to the intended
  recipient, sans the coral fee, which is transferred to coral's wallet
  */
  function initiateRelay() payable public {
    /* require(msg.sender == coralWallet); */
    txReceiver.transfer(amount.sub(coralFeeInEth));
    coralWallet.transfer(coralFeeInEth);
    messagingInterface.notifyOfInitiateRelay(txInitiator);
  }
}
